/*
  #0e1821 = dark blue
  #131317 = darkest blue
  #e4b61a = yellow
  #fee970 = light yellow
  #dbd7d4 = light grey
  #9b9183 = darkgrey
  */
/* ------------------------General CSS Styling-------------------------------------- */
body {
  font-family: 'Lato', sans-serif;
  background-color: #0e1821;
  color: #dbd7d4;
  overflow: hidden;
  display: block;
}

/* ----------------------------------logo styling------------------------------------ */
.logo img {
  display: block;
  margin: 8px auto;
  width: 24px;
  height: auto;
}
.logo {
  background: #000000;
  display: block;
  text-decoration: none;
  padding: 8px 0;
  font-family: 'Permanent Marker', cursive;
  text-align: center;
  color: #fee970;
}
.logo .logo-text {
  display: block;
  text-shadow: 0 0 8px #6a4cf1, 0 0 5px #dbd7d4;
}
.logo .letter-o {
  display: none;
  text-shadow: 0 0 8px #6a4cf1, 0 0 5px #dbd7d4;
}
.logo .logo-caption {
  display: block;
}
.logo .logo-caption-2 {
  display: none;
}
.logo p {
  font-family: 'Permanent Marker', cursive;
  color: #dbd7d4;
  font-size: 9px;
  letter-spacing: 2px;
  bottom: 0;
  /* position: absolute; */
  width: 100%;
  text-align: center;
}
/* ------------------------------------sidebar styling---------------------------- */
.sidebar {
  height: 100%;
  width: 60px;
  position: fixed;
  top: 0;
  left: 0;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  background-color: #131317;
  z-index: 3;
  min-height: 500px;
}
.sidebar ul {
  display: block;
  padding: 0;
  list-style: none;
  text-align: center;
  margin: 0;
  padding-bottom: 20px;
}
.sidebar ul li {
  display: list-item;
  /* text-align: -webkit-match-parent; */
}
.sidebar .sidenav {
  display: block;
  text-align: center;
}
.sidebar ul li a {
  padding: 7px 0;
  display: block;
  font-size: 15px;
  line-height: 16px;
  color: #909096;
}

.sidebar .sidenav a {
  font-family: 'Covered By Your Grace', cursive;
  text-decoration: none;
  font-size: 20px;
  display: block;
  font-size: 20px;
  color: #909096;
  margin-bottom: 15px;
  line-height: 51px;
  height: 51px;
  position: relative;

}
.sidebar .sidenav  a i {
  text-align: center;
  padding-top: 20px;
}

.sidebar ul li a:hover {
  color: #fee970;
}
.sidebar .sidenav a b {
  display: none;
  line-height: 51px;
  height: 51px;
}
.sidebar .sidenav a:hover i {
  color: #fee970;
  display: none;
}

.sidebar .sidenav a:hover b {
  font-family: 'Covered By Your Grace', cursive;
  color: #fee970;
  display: block;
  font-size: 12px;
  letter-spacing: 2px;
  bottom: 0;
  display: block;
  /* position: absolute; */
  width: 100%;
  text-align: center;
}

.sidebar .sidenav a {
  font-family: 'icomoon' !important;
  font-style: normal;
  font-weight: 400;
  font-feature-settings: normal;
  font-variant: normal;
  text-transform: none;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
}

.mobile-link, .mobile-menu {
  display: none;
}

/* ------------------------------Responsiveness Navbar------------------------------ */
@media (max-width: 960px) {
  .logo {
    float: left;
    padding: 2px 0;
    margin-right: 20px;
}
}
@media (max-width: 960px) and (max-width: 530px) {
  .logo {
    width: 15%;
  }
  .logo .logo-text {
    font-size: 25px;
  height: 30px;
  margin-top: 5px;
  margin-bottom: 2px;
  }
}
@media (max-width: 960px) {
  .logo>h1:first-child {
    height: 30px;
}
}

@media (max-width: 960px) {
  .logo img {
    display: block;
    margin: 5px 15px;
    width: auto;
    height: auto;
}
}

@media (max-width: 960px) {
 .sidebar {
    flex-direction: row;
    width: 100%;
    height: 60px;
    position: absolute;
    top: 0;
    left: 0;
    z-index: 3;
    min-height: 0;
}
}


@media (max-width: 530px) {
  .sidebar {
    position: fixed;
  }
}

@media (max-width: 960px) {
  .sidebar {
    flex-direction: row;
    width: 100%;
    height: 60px;
    position: absolute;
    top: 0;
    left: 0;
    z-index: 3;
    min-height: 0;
  }
}

@media (max-width: 530px) {
  .mobile-link {
    font-size: 30px;
    color: #fff;
    float: right;
    margin: 10px 20px 10px 10px;
    display: block;
}
.mobile-link:hover {
  color:#fee970;
}
}
@media (max-width: 530px) {
  .sidebar ul {
    display: none;
}
}
@media (max-width: 530px) {
  .sidebar nav {
    width: 100%;
    position: fixed;
    left: 100%;
    opacity: 0;
    margin-left: 0;
    float: left;
    overflow: hidden;
    text-align: center;
    height: 60px;
    top: 60px;
    margin-top: 0;
    background: #181818;
    transition: all .3s ease-out;
}
}
@media (max-width: 530px) {
  .sidebar nav.show {
    left: 0;
    opacity: 1;
}
.sidebar .mobile-menu {
  width: 100%;
  position: fixed;
  left: 100%;
  opacity: 0;
  margin-left: 0;
  float: left;
  overflow: hidden;
  text-align: center;
  height: 60px;
  top: 60px;
  margin-top: 0;
  background: #131317;
  transition: all .3s ease-out;
} 
.sidebar .mobile-menu a {
  float: left;
  margin-left: 0 !important;
  line-height: 60px;
  height: 60px;
  width: 20%;
  color: #909096;
}
.sidebar .mobile-menu a:hover, .sidebar .mobile-menu a:active {
  color: #fee970;
}
}






/* end of Sidebar styling */

.main {
  margin-left: 60px; /* Same as the width of the sidenav */
  padding: 0px 10px;
}

